(61, 'Solesmes', 'in_gaudeamus__mariae__reginae', 'Gaudeamus... Mariae... Reginae', 1, 'in', '1', NULL, 'Andrew Hinkley', '', '"(c4) GAU(c)DE(d)A(ixdh''!iv)MUS(h.) *(,) o(hg~)mnes(hg) in(fg) D\\u00f3(gjh)mi(ixh.g!hwihi)no,(ih..) (;) di(h)em(fg~) fes(g)tum(gff) ce(dg)le(gff)br\\u00e1(dg~)ntes(gff) (,) sub(f) ho(g)n\\u00f3(g.!hjh)re(ghg.) be(f)\\u00e1(f)tae(f) Ma(f)r\\u00ed(g)ae(f'') V\\u00edr(f)gi(h)nis(gjj) Re(h)g\\u00ed(hih___)nae:(h.) (:) de(fg) cu(fg)jus(f) so(f)lem(g)ni(g)t\\u00e1(g./hjh)te(ghg.) (,) gau(fg)dent(f) An(fg/hgh)ge(gvFE''/fwgfg)li,(gf..) (;) et(f) col(g)l\\u00e1u(g/hjHG)dant(h_g) (,) F\\u00ed(fge)li(f)um(fg/hf/gvFE) De(d!ewfef)i.(ed..) <i>T. P.</i>(::) Al(ixhi)le(h)l\\u00fa(hgh)ia,(f_d) (,) al(fg)le(e!fg/hf/gvFE)l\\u00fa(d!ewfef)ia.(ed..) <i>Ps.</i>(::) Ef(f)f\\u00fan(gh)dit(h) cor(h) me(h)um(h) ver(hj)bum(h) bo(hg)num:(gh..) *(:) di(gf)co(gh) e(h)go(h) car(h)men(hjh) me(g'')um(f) Re(fff)gi.(d.) (::) Gl\\u00f3(f)ri(gh)a(h) Pa(h)tri(h) (::) E(h) u(hjh) o(g'') u(f) a(fff) e(dc/df..) (::)"', NULL, NULL),
