(435, 'Solesmes', 'ps_omnes_gentes', 'Omnes gentes (Ps.46 - Textus antiquus)', 1, 'ps', NULL, NULL, 'Andrew Hinkley', '', '"(c4) Om(f)nes(gh) gen(h)tes,(h) pl\\u00e1u(ixi)di(hr)te(h) m\\u00e1(g)ni(hr)bus ;(h.) *(:) ju(h)bi(h)l\\u00e1(h)te(h) De(h)o(h) in(h) vo(h)ce(h) ex(h)sul(h)ta(g)ti(f)\\u00f3(gh gr)nis :(gf..) (::) 2. Qu{o}(h)ni(h)am...(h)"', NULL, '2. Quóniam Dóminus ex{\\bf cél}sus, ter{\\bf rí}bilis, * rex mágnus super {\\it omnem} {\\bf ter}ram.\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}\\\\\n\\\\\n3. Subjécit {\\bf pó}pulos {\\bf no}bis, * et gentes sub pé{\\it dibus} {\\bf no}stris.\\\\\n\\\\\n4. Elégit nobis haeredi{\\bf tá}tem {\\bf su}am ; * spéciem Jacob {\\it quam di}{\\bf lé}xit.\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}\\\\\n\\\\\n5. Ascéndit {\\bf De}us in {\\bf jú}bilo, * et Dóminus in {\\it voce} {\\bf tu}bae.\\\\\n\\\\\n6. Psállite Deo {\\bf no}stro, {\\bf psál}lite ; * psállite regi {\\it nostro,} {\\bf psál}lite :\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}\\\\\n\\\\\n7. Quóniam rex omnis {\\bf ter}rae {\\bf De}us, * psállite {\\it sapi}{\\bf én}ter.\\\\\n\\\\\n8. Regnábit Deus {\\bf su}per {\\bf gen}tes ; * Deus sedet super sedem {\\it sanctam} {\\bf su}am.\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}\\\\\n\\\\\n9. Príncipes populórum congregáti sunt cum {\\bf De}o {\\bf A}braham, * quóniam dii fortes terrae veheménter {\\it ele}{\\bf vá}ti sunt.\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}\\\\\n\\\\\n10. Glória {\\bf Pa}tri, et {\\bf Fí}lio, * et Spirí{\\it tui} {\\bf San}cto.\\\\\n\\\\\n11. Sicut erat in princípio, et {\\bf nunc,} et {\\bf sem}per, * et in saécula saecu{\\it lórum.} {\\bf A}men.\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}'),
