p>''æ</sp>(ef)mi(d)um.(cd..) (::) A(ded)men.(cd..) (::)', '\\begin{tabular}{lll}\n2.&&5.\\\\\nQuae vulneráta lánceae&&Beáta, cújus bráchiis\\\\\nMucróne díro, críminum&&Prét{\\it i}um pepéndit saéculi:\\\\\nUt nos laváret sórdibus,&&Statéra fácta córporis,\\\\\nManávit únd{\\it a} et sánguine.&&Tulítque praédam tártari.\\\\\n\\\\\n3.&&6.\\\\\nImpléta sunt quae cóncinit&&O Crux áve, spes única,\\\\\nDávid fidéli cármine,&&Hoc Passiónis témpore:\\\\\nDicéndo natiónibus:&&Píis adáuge grátiam,\\\\\nRegnávit a lígno Déus.&&Reísque déle crímina.\\\\\n\\\\\n4.&&7.\\\\\nArbor decór{\\it a} et fúlgida,&&Te, fons salútis Trínitas,\\\\\nOrnáta Régis púrpura,&&Colláudet ómnis spíritus:\\\\\nElécta dígno stípite&&Quíbus Crúcis victóriam\\\\\nTam sáncta mémbra tángere.&&Largíris, ádde praémium. Amen.\n\\end{tabular}\n\\Vbar.  Eripe, Dómine, ab hómine málo.\n\\Rbar.  A víro iníquo éripe me.'),
