(2163, 'Solesmes', 'hy_stabat_mater', 'Stabat Mater', 1, 'hy', '6', NULL, 'Andrew Hinkley', '', '"(c4) ST\\u00e1(f)bat(g'') M\\u00e1(h)ter(g'') do(h)lo(j'')r\\u00f3(ixi)sa(h.) (;) J\\u00fax(h)ta(g'') Cr\\u00fa(f)cem(e'') la(d)cri(e'')m\\u00f3(d)sa,(c.) (;) Dum(g'') pen(f)d\\u00e9(g'')bat(h) F\\u00ed(g'')li(f)us(f.) (::)\\n2. C\\u00fajus \\u00e1nimam gem\\u00e9ntem,\\nContrist\\u00e1tam et dol\\u00e9ntem,\\nPertrans\\u00edvit gl\\u00e1dius.\\n\\n3. O quam tr\\u00edstis et affl\\u00edcta\\nF\\u00fait \\u00edlla bened\\u00edcta\\nM\\u00e1ter Unig\\u00e9niti!\\n\\n4. Qu\\u00e6 m\\u00e6r\\u00e9bat et dol\\u00e9bat,\\nP\\u00eda M\\u00e1ter, dum vid\\u00e9bat\\nN\\u00e1ti p<sp>''\\u0153</sp>nas \\u00ednclyti.\\n\\n5. Quis est h\\u00f3mo qui non fl\\u00e9ret,\\nM\\u00e1trem Chr\\u00edsti si vid\\u00e9ret\\nIn t\\u00e1nto suppl\\u00edcio?\\n\\n6. Quis non p\\u00f3sset contrist\\u00e1ri,\\nChr\\u00edsti M\\u00e1trem contempl\\u00e1ri\\nDol\\u00e9ntem cum F\\u00edlio?\\n\\n7. Pro pecc\\u00e1tis s\\u00fa\\u00e6 g\\u00e9ntis\\nV\\u00eddit J\\u00e9sum in torm\\u00e9ntis,\\nEt flag\\u00e9llis s\\u00fabditum.\\n\\n8. V\\u00eddit s\\u00faum d\\u00falcem n\\u00e1tum\\nMori\\u00e9ndo desol\\u00e1tum,\\nDum em\\u00edsit sp\\u00edritum.\\n\\n9. Eia, M\\u00e1ter, fons am\\u00f3ris,\\nMe sent\\u00edre vim dol\\u00f3ris\\nFac, ut t\\u00e9cum l\\u00fageam.\\n\\n10. Fac, ut \\u00e1rdeat cor m\\u00e9um\\nIn am\\u00e1ndo Chr\\u00edstum D\\u00e9um,\\nUt s\\u00edbi compl\\u00e1ceam. Amen."', NULL, '\\begin{tabular}{llll}\n2.&Cújus ánimam geméntem,&12.&Túi Náti vulneráti,\\\\\n&Contristátam et doléntem,&&Tam dignáti pro me páti,\\\\\n&Pertransívit gládius.&&Poénas mécum dívide.\\\\\n\\\\\n3.&O quam trístis et afflícta&13.&Fac me técum pie flére,\\\\\n&Fúit ílla benedícta&&Crucifíxo condolére,\\\\\n&Máter Unigéniti!&&Donec égo víxero.\\\\\n\\\\\n4.&Quae maerébat et dolébat,&14.&Juxta Crúcem técum stáre,\\\\\n&Pía Máter, dum vidébat&&Et me tíbi sociáre\\\\\n&Náti poénas ínclyti.&&In plánctu desídero.\\\\\n\\\\\n5.&Quis est hómo qui non fléret,&15.&Vírgo vírginum praeclára,\\\\\n&Mátrem Chrísti si vidéret&&Míhi jam non sis amára:\\\\\n&In tánto supplício?&&Fac me técum plángere.\\\\\n\\\\\n6.&Quis non pósset contristári,&16.&Fac, ut pórtem Chrísti mórtem,\\\\\n&Chrísti Mátrem contemplári&&Passiónis fac consórtem,\\\\\n&Doléntem cum Fílio?&&Et plágas recólere.\\\\\n\\\\\n7.&Pro peccátis súae géntis&17.&Fac me plágis vulnerári,\\\\\n&Vídit Jésum in torméntis,&&Fac me Crúc{\\it e} inebriári,\\\\\n&Et flagéllis súbditum.&&Et cruóre Fílii.\\\\\n\\\\\n8.&Vídit súum dúlcem Nátum&18.&Flámmis ne úrar succénsus,\\\\\n&Moriéndo desolátum,&&Per te, Vírgo, sim defénsus\\\\\n&Dum emísit spíritum.&&In díe judícii.\\\\\n\\\\\n9.&Eia, Máter, fons amóris,&19.&Chríste, cum sit hinc exíre,\\\\\n&Me sentíre vim dolóris&&Da per Mátrem me veníre\\\\\n&Fac, ut técum lúgeam.&&Ad pálmam victóriae.\\\\\n\\\\\n10.&Fac, ut árdeat cor méum&20.&Quando córpus moriétur,\\\\\n&In amándo Chrístum Déum,&&Fac, ut ánimae donétur\\\\\n&Ut síbi compláceam.&&Paradísi glória. Amen\\\\\n\\\\\n11.&Sáncta Máter, ístud ágas,\\\\\n&Crucifíxi fíge plágas\\\\\n&Córdi méo válide.\n\\end{tabular}'),
