(2235, 'Solesmes', 'hy_te_joseph_celebrent', 'Te Joseph celebrent', 1, 'hy', NULL, NULL, 'Andrew Hinkley', '', '"(c4) TE(d) Jo(fe)seph(f) c\\u00e9(g'')le(h)brent(dc) \\u00e1g(f)mi(e'')na(f) c<sp>''\\u00e6</sp>(d)li(c)tum:(cd..) (;) Te(dh) cun(g)cti(fe) r\\u00e9(f'')so(g)nent(gh) chri(hg)st\\u00ed(h'')a(i)dum(j) cho(ih)ri,(h.) (:) Qui(hk) cla(ji)rus(hg) m\\u00e9(h'')ri(g)tis,(fe) jun(dg)ctus(f'') es(d) \\u00edn(e)cl\\u00fd(dc)t\\u00e6(c.) (;) Ca(e)sto(gh) f<sp>''\\u0153</sp>(dc)de(d'')re(e) V\\u00edr(f)gi(ed)ni.(d.) (::)"', '2. Al(d)mo(fe) cum(f) tú(g'')mi(h)dam(dc) gér(f)mi(e'')ne(f) cón(d)ju(c)gem(cd..) (;) Ad(dh)mí(g)rans,(fe) dú(f'')bi(g)o(gh) tán(hg)ge(h'')ris(i) án(j)xi(ih)us,(h.) (:) Af(hk)flá(ji)tu(hg) sú(h'')pe(g)ri(fe) Flá(dg)mi(f'')nis(d) An(e)ge(dc)lus(c.) (;) Con(e)cé(gh)ptum(dc) pú(d'')e(e)rum(f) do(ed)cet.(d.) 3.(::) Tu(d) na(fe)tum(f) Dó(g'')mi(h)num(dc) strin(f)gis,(e'') ad(f) éx(d)te(c)ras(cd..) (;) æ(dh)gýp(g)ti(fe) pró(f'')fu(g)gum(gh) tu(hg) sé(h'')que(i)ris(j) pla(ih)gas:(h.) (:) A(hk)mís(ji)sum(hg) Só(h'')lý(g)mis(fe) qu<sp>''æ</sp>(dg)ris,(f'') et(d) ín(e)ve(dc)nis,(c.) (;) Mi(e)scens(gh) gáu(dc)di(d'')a(e) flé(f)ti(ed)bus.(d.) 4.(::) Post(d) mor(fe)tem(f) ré(g'')lo(h)quos(dc) sors(f) pi(e'')a(f) cón(d)se(c)crat,(cd..) (;) Pal(dh)mám(g)qu<i>e</i>(f'') e(e)mé(f'')ri(g)tos(gh) gló(hg)ri(h'')a(i) sú(j)sci(ih)pit:(h.) (:) Tu(hk) vi(ji)vens,(hg) Sú(h'')pe(g)ris(fe) par,(dg) frú(f'')e(d)ris(e) De(dc)o,(c.) (;) Mi(e)ra(gh) sor(dc)te(d'') be(e)á(f)ti(ed)or.(d.) 5.(::) No(d)bis,(fe) sum(f)ma(g'') Tri(h)as,(dc) par(f)ce(e'') pre(f)cán(d)ti(c)bus:(cd..) (;) Da(dh) Jo(g)seph(fe) mé(f'')ri(g)tis(gh) sí(hg)de(h'')ra(i) scán(j)de(ih)re,(h.) (:) Ut(hk) tan(ji)dem(hg) lí(h'')ce(g)at(fe) nos(dg) ti(f'')bi(d) pér(e)pe(dc)tim(c.) (;) Gra(e)tum(gh) pró(dc)me(d'')re(e) cán(f)ti(ed)cum.(d.) (::) A(ded)men.(cd..) (::)', '\\begin{tabular}{ll}\n2.&Almo cum túmidam gérmine cónjugem\\\\\n&Admirans dúbio tángeris ánxius,\\\\\n&Afflátu súperi Fláminis, Angelus\\\\\n&Concéptum púerum dócet.\\\\\n\\\\\n3.&Tu nátum Dóminum stríngis, ad éxteras\\\\\n&Aegýpti prófugum tu séqueris plágas:\\\\\n&Amíssum Sólymis quaéris et ínvenis,\\\\\n&Míscens gáudia flétibus.\\\\\n\\\\\n4.&Post mórtem réliquos sors pía cónsecrat,\\\\\n&Palmámqu{\\it e} eméritos glória súscipit:\\\\\n&Tu vívens, Súperis par, frúeris Déo,\\\\\n&Míra sórte beátior.\\\\\n\\\\\n5.&Nóbis, súmma Trías, párce precántibus:\\\\\n&Da Jóseph méritis sídera scándere\\\\\n&Ut tándem líceat nos tíbi pérpetim\\\\\n&Grátum prómere cánticum. Amen.\n\\end{tabular}'),
