(2274, 'Solesmes', 'hy_sacris_solemniis', 'Sacris solemniis', 1, 'hy', '4', NULL, 'Andrew Hinkley', '', '"(c4) SAc(dh''!iv)ris(h) so(hg)l\\u00e9(h!iwj)mni(ivHG)is(h.) (,) j\\u00fanc(h)ta(f'') sint(g) g\\u00e1u(g'')di(f)a,(e.) (;) Et(f'') ex(g) pr\\u00e6(f!gh)c\\u00f3r(f'')di(e)is(d.) (,) s\\u00f3(f)nent(d'') pr\\u00e6(c)c\\u00f3(ef)ni(d)a:(d.) (:) Re(h'')c\\u00e9(i)dant(ji) v\\u00e9(g'')te(h)ra,(g.) (,) n\\u00f3(ih)va(i) sint(ji) \\u00f3(h'')mni(g)a,(h.) (;) C\\u00f3r(ix//dh''!iv)da,(h'') v\\u00f3(g)ces(fvED'') et(e) \\u00f3(fg)pe(f)ra.(e.) (::)"', '2.() Nó(dh''!iv)ctis(h) re(hg)có(h!iwj)li(ivHG)tur(h.) (,) c<sp>''œ</sp>(h)na(f'') no(g)vís(g'')si(f)ma,(e.) (;) Qua(f'') Chrí(g)stus(f!gh) cré(f'')di(e)tur(d.) (,) á(f)gnum(d'') et(c) á(ef)zy(d)ma(d.) (:) De(h'')dís(i)se(ji) frá(g'')tri(h)bus,(g.) (,) jux(ih)ta(i) le(ji)gí(h'')ti(g)ma(h.) (;) Prí(ix//dh''!iv)scis(h'') in(g)dúl(fvED'')ta(e) pá(fg)tri(f)bus.(e.) (::) \n3.() Post(dh''!iv) á(h)gnum(hg) tý(h!iwj)pi(ivHG)cum,(h.) (,) ex(h)plé(f'')tis(g) é(g'')pu(f)lis,(e.) (;) Cór(f'')pus(g) Do(f!gh)mí(f'')ni(e)cum(d.) (,) dá(f)tum(d'') di(c)scí(ef)pu(d)lis,(d.) (:) Sic(h'') tó(i)tum(ji) ó(g'')mni(h)bus,(g.) (,) quod(ih) tó(i)tum(ji) sín(h'')gu(g)lis,(h.) (;) E(ix//dh''!iv)jus(h'') fa(g)té(fvED'')mur(e) má(fg)ni(f)bus.(e.) (::) \n4.() Dé(dh''!iv)dit(h) fra(hg)gí(h!iwj)li(ivHG)bus(h.) (,) cór(h)po(f'')ris(g) fér(g'')cu(f)lum,(e.) (;) Dé(f'')dit(g) et(f!gh) trí(f'')sti(e)bus(d.) (,) sán(f)gui(d'')nis(c) pó(ef)cu(d)lum,(d.) (:) Dí(h'')cens:(i) Ac(ji)cí(g'')pi(h)te(g.) (,) quod(ih) trá(i)do(ji) vá(h'')scu(g)lum,(h.) (;) O(ix//dh''!iv)mnes(h'') ex(g) é(fvED'')o(e) bí(fg)bi(f)te.(e.) (::) \n5.() Sic(dh''!iv) sa(h)cri(hg)fí(h!iwj)ci(ivHG)um(h.) (,) í(h)stud(f'') in(g)stí(g'')tu(f)it,(e.) (;) Cú(f'')jus(g) of(f!gh)fí(f'')ci(e)um(d.) (,) com(f)mít(d'')ti(c) vó(ef)lu(d)it(d.) (:) Só(h'')lis(i) pres(ji)bý(g'')te(h)ris,(g.) (,) qui(ih)bus(i) sic(ji) cón(h'')gru(g)it.(h.) (;) Ut(ix//dh''!iv) sú(h'')mant,(g) et(fvED'') dent(e) cé(fg)te(f)ris.(e.) (::) \n6.() PÁ(dh''!iv)NIS(h) AN(hg)GÉ(h!iwj)LI(ivHG)CUS(h.) (,) fit(h) pá(f'')nis(g) hó(g'')mi(f)num:(e.) (;) Dat(f'') pá(g)nis(f!gh) c<sp>''æ</sp>(f'')li(e)cus(d.) (,) fi(f)gú(d'')ris(c) tér(ef)mi(d)num:(d.) (:) O(h'') res(i) mi(ji)rá(g'')bi(h)lis!(g.) (,) man(ih)dú(i)cat(ji) Dó(h'')mi(g)num(h.) (;) Páu(ix//dh''!iv)per,(h'') sér(g)vus,(fvED'') et(e) hú(fg)mi(f)lis.(e.) (::) \n7.() Te(dh''!iv) tri(h)na(hg) Dé(h!iwj)i(ivHG)tas(h.) (,) ú(h)na(f'')que(g) po(g'')scí(f)mus,(e.) (;) Sic(f'') nos(g) tu(f!gh) ví(f'')si(e)ta,(d.) (,) si(f)cut(d'') te(c) có(ef)li(d)mus:(d.) (:) Per(h'') tu(i)as(ji) sé(g'')mi(h)tas(g.) (,) duc(ih) nos(i) quo(ji) tén(h'')di(g)mus,(h.) (;) Ad(ix//dh''!iv) lu(h'')cem(g) quam(fvED'') in(e)há(fg)bi(f)tas.(e.) (::) A(efe)men.(de..) (::)', 'Noctis recólitur coena novíssima,\\\\\nQua Christus créditur agnum et ázyma\\\\\nDedísse frátribus, juxta legítima\\\\\nPriscis indúlta pátribus.\\\\\n\\\\\nPost agnum týpicum, explétis épulis,\\\\\nCorpus Domínicum datum discípulis,\\\\\nSic totum ómnibus, quod totum síngulis,\\\\\nEjus fatémur mánibus.\\\\\n\\\\\nDedit fragílibus córporis férculum,\\\\\nDedit et trístibus sánguinis póculum,\\\\\nDicens: Accípite quod trado vásculum,\\\\\nOmnes ex eo bíbite.\\\\\n\\\\\nSic sacrifícium istud instítuit,\\\\\nCujus offícium commítti vóluit\\\\\nSolis presbýteris, quibus sic cóngruit,\\\\\nUt sumant, et dent céteris.\\\\\n\\\\\nPanis angélicus fit panis hóminum;\\\\\nDat panis caélicus figúris términum:\\\\\nO res mirábilis! mandúcat Dóminum\\\\\nPauper, servus, et húmilis.\\\\\n\\\\\nTe trina Déitas únaque póscimus,\\\\\nSic nos tu vísita, sicut te cólimus:\\\\\nPer tuas sémitas duc nos quo téndimus,\\\\\nAd lucem quam inhábitas. Amen.'),
