(3029, 'Solesmes', NULL, 'Languentibus in Purgatorio', 1, 'hy', '6', NULL, 'Andrew Hinkley', NULL, '"(cb4) LAn(d)gu\\u00e9n(f'')ti(g)bus(f_'') in(i) Pur(hg)ga(f)t\\u00f3r(e'')i(f)o,(f) (;)\\r\\nQui(h) pur(j'')g\\u00e1n(k)tur(j_'') ar(i)d\\u00f3(h'')re(g) n\\u00ed(h'')mi(j)o,(j.) (;)\\r\\nEt(j) tor(h'')qu\\u00e9n(i)tur(h_'') gr\\u00e1(g)vi(f'') sup(e)pl\\u00ed(f'')ci(g)o,(g.) (;)\\r\\nSub(h'')v\\u00e9(j)ni(i)at(i_'') t\\u00fa(h)a(g'') com(f)p\\u00e1s(g'')si(h)o:(h.) (,)\\r\\nO(hig) Ma(fe)r\\u00ed(gh)a.(gf..) (::)"', NULL, '\\begin{tabular}{ll}\r\n2. &Fons es pátens qui cúlpas ábluis,\\\\\r\n&Omnes júvas et núllum réspuis:\\\\\r\n&Mánum túam exténde mórtuis,\\\\\r\n&Qui sub poénis lánguent contínuis: O María!\\\\\r\n\\\\\r\n3. &Ad te píe suspírant mórtui,\\\\\r\n&Cupiéntes de poénis érui,\\\\\r\n&Et adésse túo conspéctui,\\\\\r\n&\\AE ternísque gáudiis pérfrui: O María!\\\\\r\n\\\\\r\n4. &Geméntibus Máter accélera,\\\\\r\n&Pietátis osténde víscera:\\\\\r\n&Illos Jésu per súa vúlnera\\\\\r\n&Ut sanáre dignétur ímpetra: O María!\\\\\r\n\\\\\r\n5. &Tu véra spes ad te clamántium:\\\\\r\n&Ad te clámat túrba sodálium,\\\\\r\n&Pro frátribus ut pláces Fílium,\\\\\r\n&Et caeléste det éis praémium: O María!\\\\\r\n\\\\\r\n6. &Fac lácrimae quas bóna réspicis,\\\\\r\n&Quas fúndimus ad pédes Júdicis,\\\\\r\n&Mox exstínguant vim flámmae víndicis,\\\\\r\n&Ut jungántur chóris angélicus: O María!\\\\\r\n\\\\\r\n7. &Et cum fíet strícta discússio,\\\\\r\n&In treméndo Déi judício,\\\\\r\n&Judicánti súpplica Fílio,\\\\\r\n&Ut cum Sánctis sit nóbis pórtio: O María! Amen.\r\n\\end{tabular}'),
(3030, 'Solesmes', NULL, 'Maria Mater gratiae', 1, 'hy', '2', NULL, 'Andrew Hinkley', NULL, '"(c4)MA(h)r\\u00ed(h_g)a,(ed) M\\u00e1(g)ter(hj) gr\\u00e1(ji)ti(h)\\u00e6,(i.) (;)\\r\\nD\\u00fal(hk)cis(k) P\\u00e1(i)rens(ji) cle(h)m\\u00e9n(ih)ti(g)\\u00e6,(h.) (:)\\r\\nTu(k) nos(k'') ab(i) h\\u00f3s(k)te(klk) pr\\u00f3(ji)te(hi)ge,(ivHG.) (;)\\r\\nEt(ji) m\\u00f3r(jk)tis(i) h\\u00f3(ji)ra(h) s\\u00fa(ih)sci(g)pe.(h.) 2.(::)\\r\\n\\r\\nJ\\u00e9(h)su,(h_g) t\\u00ed(ed)bi(g) sit(hj) gl\\u00f3(ji)ri(h)a,(i.) (;)\\r\\nQui(hk) n\\u00e1(k)tus(i) es(ji) de(h) V\\u00edr(ih)gi(g)ne,(h.) (:)\\r\\nCum(k) P\\u00e1tre(k'') et(i) \\u00e1l(k)mo(klk) Sp\\u00ed(ji)ri(hi)tu,(ivHG.) (;)\\r\\nIn(ji) sem(jk)pi(i)t\\u00e9r(ji)nam(h) sa\\u00e9(ih)cu(g)la.(h.) (::)\\r\\n\\r\\nA(hih)men.(g.h.) (::)"', NULL, NULL),
(3031, 'Solesmes', NULL, 'O filii et filiae', 1, 'hy', '2', NULL, 'Andrew Hinkley', NULL, '"(c3) AL(f)le(f)l\\u00fa(g)ia,(fe) al(f)le(hg)l\\u00fa(f)ia,(c.) (;)\\r\\nal(g)le(h)l\\u00fa(g)ia.(f.) (::) (Z)\\r\\nO(f) f\\u00ed(h)li(i)i(ji) et(h) f\\u00ed(ih)li(g)ae,(f.) (;)\\r\\nRex(f) cae(h)l\\u00e9s(i)tis,(ji) Rex(h) gl\\u00f3(ih)ri(g)ae,(f.) (;)\\r\\nM\\u00f3r(f)te(f) sur(g)r\\u00e9(fe)xit(f) h\\u00f3(hg)di(f)e(c.) (;)\\r\\nal(g)le(h)l\\u00fa(g)ia.(f.) (::)"', NULL, '\\begin{tabular}{lll}\r\n2.&Et máne prima sábbati,\\\\\r\n&Ad óstium monuménti\\\\\r\n&Accessérunt discípuli, allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n3.&Et María Magdaléne,\\\\\r\n&Et Jacóbi, et Salóme,\\\\\r\n&Venérunt córpus úngere, allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n4.&In álbis sédens Angelus\\\\\r\n&Praedíxit muliéribus:\\\\\r\n&In Galilaé{\\it a} est Dóminus, allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n5.&Et Joánnes apóstolus\\\\\r\n&Cucúrrit Pétro cítius,\\\\\r\n&Monuménto vénit prius, allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n6.&Discípulis adstántibus,\\\\\r\n&In médio stétit Chrístus,\\\\\r\n&Dícens: Pax vóbis ómnibus, allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n7.&Ut intelléxit Dídymus,\\\\\r\n&Quia surrexérat Jésus,\\\\\r\n&Remánsit fere dúbius, allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n8.&Víde Thóma, víde látus,\\\\\r\n&Víde pédes, víde mánus,\\\\\r\n&Nóli ésse incrédulus, allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n9.&Quando Thómas Chrísti látus,\\\\\r\n&Pedes, vídit atque mánus,\\\\\r\n&Díxit: Tu es Déus méus, allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n10.&Beáti qui non vidérunt,\\\\\r\n&Et fírmiter credidérunt,\\\\\r\n&Vítam aetérnam habébunt, allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n11.&In hoc fésto sanctíssimo\\\\\r\n&Sit laus et jubilátio:\\\\\r\n&{\\sc Benedicámus Dómino,} allelúia.&\\Rbar . Allelúia.\\\\\r\n\\\\\r\n12.&Ex quíbus nos humíllimas\\\\\r\n&Dévotas atque débitas\\\\\r\n&{\\sc Déo} dícamus {\\sc Grátias,} allelúia.&\\Rbar . Allelúia.\r\n\\end{tabular}'),
