(3039, 'Solesmes', NULL, 'Puer natus in Bethlehem', 1, 'hy', '1', NULL, 'Andrew Hinkley', NULL, '"(c4)PU(d)er(f'') n\\u00e1(f)tus(e'') in(f) B\\u00e9th(g'')le(f)hem,(e'') al(d)le(f'')l\\u00fa(e)ia:(d.) (;)\\r\\nUn(d)de(f'') g\\u00e1u(g)det(h'') Je(g)r\\u00fa(h'')sa(g)lem,(f.) (;)\\r\\nal(f)le(f'')l\\u00fa(f)ia,(f'') al(h)le(g'')l\\u00fa(f)ia.(e.) (::)\\r\\nIn(d) c\\u00f3r(f'')dis(g) j\\u00fa(h'')bi(ixi)lo,(j.) (,)\\r\\nChr\\u00eds(j)tum(f'') n\\u00e1(f)tum(f'') a(h)do(g'')r\\u00e9(f)mus,(e.) (;)\\r\\nCum(d) n\\u00f3(f'')vo(f) c\\u00e1n(e'')ti(e)co.(d.) (::)"', NULL, '\\begin{tabular}{ll}\r\n2. &Assúmpsit cárnem Fílius, allelúia,\\\\\r\n&Déi Pátris altíssimus, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n3. &Per Gabriélem núntium, allelúia,\\\\\r\n&Vírgo concépit Fílium, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n4. &Tamquam spónsus de thálamo, allelúia,\\\\\r\n&Procéssit Mátris útero, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n5. &Hic jácet in praesépio, allelúia:\\\\\r\n&Qui régnat sine término, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n6. &Et Angelus pastóribus, allelúia,\\\\\r\n&Revélat quod sit Dóminus, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n7. &Réges de Sába véniunt, allelúia,\\\\\r\n&Aurum, thus, mýrrham ófferunt, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n8. &Intrántes dómum ínvicem, allelúia,\\\\\r\n&Nóvum salútant Príncipem, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n9. &De Mátre nátus Vírgine, allelúia,\\\\\r\n&Qui lúmen est de lúmine, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n10. &Sine serpéntis vúlnere, allelúia,\\\\\r\n&De nóstro vénit sánguine, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n11. &In cárne nóbis símilis, allelúia,\\\\\r\n&Peccáto sed dissímilis, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n12. &Ut rédderet nos hómines, allelúia,\\\\\r\n&Déo et síbi símiles, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n13. &In hoc natáli gáudio, allelúia:\\\\\r\n&Benedicámus Dómino, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n14. &Laudétur sáncta Trínitas, allelúia,\\\\\r\n&Déo dicámus grátias, allelúia, allelúia. \\Rbar . In córdis.\r\n\\end{tabular}'),
(3040, 'Solesmes', NULL, 'Rosa vernans', 1, 'al', '4', NULL, 'Andrew Hinkley', NULL, '"(c4)AL(ee/feg)le(gheg)l\\u00fa(gg/hhg/h!ij)ia(j.) *(,) <i>ij.</i>(jjvIG''g//fhGE.) (,) (ghg/jj/ghg/ee) (,) (ghg/jvIHivHGhvGE.) (,) (efe/hhg/gh/gvFDe.) (,) (eg/fge.//egFD.//egF''De.) (::) (Z)\\r\\n1.() <sp>V/</sp>.() R\\u00f3(ghg)sa(jj) v\\u00e9r(ghg)nans(ee) ca(dfde)ri(egf)t\\u00e1(fhg)tis,(g.) (;) l\\u00ed(gh)li(g)um(jj) vir(gh)gi(fvED)ni(egF''D)t\\u00e1(egF''D)tis,(e.) (:) st\\u00e9l(gfh)la(gg) f\\u00fal(i/ij!kvJH)gens,(g.) (,) Ma(j/jgh//fdg)r\\u00ed(egF''Df)a,(e.) (;) vas(jj/ghf/f/dge/e/ced) sanc(e)ti(f)t\\u00e1(ee)tis,(d.) *(;) \\u00f3(eed/ffvED//gvv/fhg/iijH''GF)ra(e.) (;) pro(ff) n\\u00f3(fdg)bis(gheg.) (,) D\\u00f3(gg/hhg/h!ij)mi(ij)num(j.) (,) (jjvIG''g//fhGE.) (,) (ghg/jj/ghg/ee) (,) (ghg/jvIHivHGhvGE.) (,) (efe/hhg/gh/gvFDe.) (,) (eg/fge.//egFD.//egF''De.) (::)"', NULL, '\\begin{tabular}{llll}\r\n2. &\\Vbar . Gémma lúcens puritátis,&3.&\\Vbar . Cújus pártus singuláris,\\\\\r\n&lúmine divinitátis,&&víncula mortalitátis\\\\\r\n&nóbis ádsis María,&&nóbis scíndit, María,\\\\\r\n&thus suavitátis,&&lux libertátis,\\\\\r\n&óra pro nobis Dóminum.&&óra pro nóbis Dóminum.\r\n\\end{tabular}\r\n\r\n\\setlength{\\parindent}{0in}\r\n{\\it During the Year:}\\\\\r\n\\Vbar . Ora pro nóbis, sáncta Déi Génitrix.\\\\\r\n\\Rbar . Ut dígni efficiámur promissiónibus Chrísti.\\\\\r\n\\\\\r\n{\\it During Advent:}\\\\\r\n\\Vbar . Angelus Dómini nuntiávit Maríae.\\\\\r\n\\Rbar . Et concépit de Spíritu Sáncto.\\\\\r\n\\\\\r\n{\\it At Christmastide:}\\\\\r\n\\Vbar . Post pártum, Vírgo, invioláta permansísti.\\\\\r\n\\Rbar . Déi Génetrix, intercéde pro nóbis.\\\\\r\n\\\\\r\n{\\it In Paschal Time:}\\\\\r\n\\Vbar . Gáude et laetáre, Vírgo María, allelúia.\\\\\r\n\\Rbar . Quia surréxit Dóminus vére, allelúia.'),
